import styled from 'styled-components';

export const s = {
    Nav: styled.nav `
        margin: 0;
        font-size: 1rem;
        font-weight: 400;
        line-height: 1.5;
        color: #888;
        text-align: left;
        background-color: floralwhite;
        position: sticky;
        top: 0;
        left: 0;
        right: 0;
        z-index: 2;
        width: 100%;
        margin-bottom: 40px;
`,
    NavList: styled.ul`
        display: flex;
        padding-left: 0;
        margin-bottom: 0;
        list-style: none;
    `,
    NavItem: styled.li`
    
    `,
    NavLink: styled.a`
        display: block;
        padding: 0.5rem 1rem;
        color: #fff;
        text-decoration: none;
        background-color: transparent;
    `,
};
